import React from 'react'

export default function Categories(props) {


  return (
    <React.Fragment>
        <div>
            {props.categoriesData.map((elem)=>{
              <div>
                <div style={{backgroundImage:`url9`}}>
                  <h1>{elem.category}</h1>
                </div>
              </div>
            })}
        </div>
    </React.Fragment>
  )
}
